import React from "react";
import { Logo } from "../../../images/Logo.jpg";

const UserName = ({ nombre, apellido }) => {
  return (
    <div className=" absolute top-5 right-5 flex font-[Helvetica Neue] bg-gradient-to-b from-gray-800 to-black">
      <h1 className=" font-semibold font-[Helvetica Neue] m-2 text-2xl">
        {nombre}
      </h1>
      <h className=" font-semibold font-[Helvetica Neue] m-2 text-2xl">
        {apellido}
      </h>
    </div>
  );
};

export default UserName;
